import { BrowserRouter as Router, Switch, Route } from 'react-router-dom'

const App = () => {
  return (
    <AuthProvider>
    <Container
      className="d-flex align-items-center justify-content-center"
      style={{ minHeight: "100vh" }}
    >
      <div className="w-100" style={{ maxWidth: "400px" }}>
        <Router>

        </Router>
      <Signup />
      </div>
    </Container>
    </AuthProvider>
  );
};

export default App;
